    private double total = 0;
    private double count = 0;
    private double average = 0;

    private string selectedSort;
    public string SelectedSort
    {
        get { return selectedSort; }
        set
        {
            selectedSort = value;
            selectedSortDictionary[selectedSort]();
        }
    }

    // Sorted data
    Dictionary<string, Action> selectedSortDictionary;

    private Root[] info;

    // Get Data
    protected override async Task OnInitializedAsync()
    {
        info = await Http.GetFromJsonAsync<Root[]>("https://api.n.exchange/en/api/v1/info/bulk/");
        // Storing sorted data
        selectedSortDictionary = new Dictionary<string, Action>
        {
            ["asc"] = () => info = info.OrderBy(s => s.rate_id).ToArray(),
            ["des"] = () => info = info.OrderByDescending(s => s.rate_id).ToArray(),
            ["baseA"] = () => info = info.OrderBy(s => s.rate).ToArray(),
            ["baseD"] = () => info = info.OrderByDescending(s => s.rate).ToArray(),
            ["pairA"] = () => info = info.OrderBy(s => s.pair).ToArray(),
            ["pairD"] = () => info = info.OrderByDescending(s => s.pair).ToArray(),
        };
    }

    // Get average function
    public void AverageBaseRate()
    {
        foreach (var items in info)
        {
            count++;
            total += (Convert.ToDouble(items.rate));
        }
        average = total / count;
    }

    // Other class
    public class Root
    {
        public string pair { get; set; }
        public string from { get; set; }
        public string to { get; set; }
